input=real
data=input.split("\n")
for i in range(0,len(data)):
    data[i]=list(data[i])
num_movable_rolls=0
removed_rolls=1
next_data=copy.deepcopy(data)
while removed_rolls > 0:
    print(f"Last iteration removed {removed_rolls} rolls.")
    removed_rolls=0
    data=copy.deepcopy(next_data)
    for i in range(0,len(data)):
        for j in range(0,len(data[i])):
            if data[i][j] == "@":
                #print(f"    Spot at row {i} column {j} contains paper. Checking boundaries.")
                num_adj=0
                spotstotry=[[i+1,j+1],[i+1,j+0],[i+1,j-1],
                            [i+0,j+1],[i+0,j-1],
                            [i-1,j+1],[i-1,j+0],[i-1,j-1],]
                for spot in spotstotry:
                    try:
                        if spot[0] < 0 or spot[1] < 0:
                            raise ValueError
                        if data[spot[0]][spot[1]]=="@":
                            #print(f"    Roll at row {spot[0]}, column {spot[1]}")
                            num_adj+=1
                        else:
                            #print(f"    No roll at row {spot[0]}, column {spot[1]}")
                            pass
                    except:
                        #print(f"    No space at row {spot[0]}, column {spot[1]}")
                        pass
                
                if num_adj<4:
                    num_movable_rolls+=1
                    removed_rolls+=1
                    next_data[i][j]="."
                    #print(f"        Less than four adjacent rolls.")

print(num_movable_rolls)
